import './App.css';

function App() {
  return (
    <form name='form'>
      <header className="App-header">
        <div className="form-group">
          <input type="text" id="name" className="form-control txt" placeholder="Product name" />
          <input type="text" id="description" className="form-control txt" placeholder="Product desctiption" />
          <input type="text" id="price" className="form-control txt" placeholder="Product price" />
          <input type="file" id="image" className="form-control txt" placeholder="Image" />
          <button id="name" className='form-control btn primary-btn'>Add</button>
        </div>
      </header>
    </form>
  );
}

export default App;
